import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Slider from './components/Acasa/Slider';
import Testimonial from './components/Despre/Testimonial';
import { SliderData } from './components/Acasa/SliderData';
import { TestimonialData } from './components/Despre/TestimonialData';
import './App.css';
import JobSection from './components/Acasa/JobSection';
import { JobSectionData } from './components/Acasa/JobSectionData';
import Footer from './components/Footer';
import Banner from './components/Acasa/Banner';
import Strenghts from './components/Despre/Strenghts';
import {StrenghtsData} from './components/Despre/StrenghtsData';
import ServicesSlider from './components/Acasa/ServicesSlider';
import Locations from './components/Despre/Locations';

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Slider slides={SliderData}/>  
        <ServicesSlider />
        <Locations/>
        <Banner/>
        <JobSection {...JobSectionData} />
        <Footer/>
      </Router>

    </>
  );
}

export default App;
